    "2016-07-27T23:02:33.219985",nt"name": "nesting-ecology-and-habitat-requirements-of-geese-at-kokechik-bay-yukon-kuskokwim-delta-al-b702d",nt"isopen":
    false,nt"url": null,nt"notes": "This paper summarizes the results of the
    third of a five-year study on the breeding biology and habitat requirements of geese
    nesting at Kokechik Bay, Alaska. Data were collected from May 1st to July 7th, 1984.
    The primary objectives of this field season were to: observe the behavior of emperor
    geese and cackling Canada geese in spring; continue the study of the comparative
    nesting ecology of geese, with emphasis on how the choice of habitat varies between
    species and among successful and unsuccessful nesting pairs; continue the study
    of clutch size in emperor geese emphasizing the occurrence of intraspecific nest
    parasitism and factors influencing its occurrence; and the incubation behavior of
    geese and the ecological significance of that behavior.",nt"license_title":
